import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';
import CropPredictionForm from './CropPredictionForm';

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Switch>
          <Route path="/crop-prediction">
            <CropPredictionForm />
          </Route>
          {/* Add more routes for Home and Weather */}
          <Route path="/weather">
            {/* Weather component goes here */}
          </Route>
          <Route path="/">
            {/* Home component goes here */}
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
